Mongoose query inside a .then, receiving warnings and errors despite working<p>I am a little bit confused after reading around the documentation on whether or not I can do a mongoose query within a promise handle. In this case I am trying to loop over an array of objects in portfolio.coin and then look up their current prices in another model. Is there a better way to do this? The following code works, but I get Unhandledpromiserejection warnings and documentnotfound error. </p>

<pre><code>// @route:       GET api/portfolio/
// @description: Get the latest portfolio with price changes
// @access:      Private
router.get('/', passport.authenticate('jwt',
  { session: false }), (req, res) =&gt; {
    Portfolio.findOne({
      user: req.user.id
    }).then(portfolio =&gt; {
      if (portfolio) {
        // Loop over all the coins in the portfolio
        portfolio.coin.forEach((item, index) =&gt; {

          // In scope object 
          let details = {
            _id: item._id,
            exchange: item.exchange,
            currencyname: item.currencyname,
            currencyquantity: item.currencyquantity,
            currencypaidwith: item.currencypaidwith,
            pricepaid: item.pricepaid,
            currentprice: 0,
            pricedifference: 0
          };

          // For each coin find the market prices
          Market.findOne({
            exchange: item.exchange,
            coin_one: item.currencyname,
            coin_two: item.currencypaidwith
          }).then(result =&gt; {
            if (result) {

              // details
              details.currentprice = result.price;
              details.pricedifference = result.price; // TODO: percentage 
              portfolio.coin[index] = details;

              if (portfolio.coin.length &gt;= index) {
                portfolio.save().then(portfolio =&gt; res.json(portfolio)).catch(err =&gt; res.status(404).json({ nodoc: "somethin went wrong" }));
              }
            }
          }).catch(err =&gt; res.status(404).json({ nodoc: "could not find a doc" }))
        });
      }
    })
  })
</code></pre>

