mongo aggregation calculate on each document with least value<p>again hoping for help .. I would like to change my existing aggregation from "find only min and max for each type" to "find least value and calculate the difference for all others per type". But I currently have no idea how merge this together. I could query for both separately and do the calculation somehow in nodejs, but I would like to know how this should be done inside a mongo aggregation.</p>

<p>Given the following data</p>

<pre><code>    { departement : 'C_TG', type : 'FLAT_1', offer: 500, req: 495 }
    { departement : 'D_TG', type : 'FLAT_1', offer: 422, req: 420 }
    { departement : 'F_TG', type : 'FLAT_1', offer: 600, req: 480 }

    { departement : 'C_TG', type : 'FLAT_7', offer: 900, req: 889 }
    { departement : 'D_TG', type : 'FLAT_7', offer: 601, req: 500 }
    { departement : 'F_TG', type : 'FLAT_7', offer: 600, req: 590 }

    { departement : 'C_TG', type : 'FLAT_4', offer: 601, req: 599 }
    { departement : 'D_TG', type : 'FLAT_4', offer: 755, req: 735 }
    { departement : 'F_TG', type : 'FLAT_4', offer: 600, req: 590 }
</code></pre>

<p>I am trying to find the difference of the "least" offer (for each type (eg. FLAT_1)) to all documents (of the same type).</p>

<p>Therefore, it would be necessary to</p>

<ul>
<li>for each type (eg. FLAT_1),</li>
<li>find the least offer for this type (FLAT_1, in this case "offer: 422" from "departement : 'D_TG'")</li>
<li>put this "least_offer and its least_offer_departement" to memory ...</li>
<li><p>... to be able to calculate the difference in ALL sets of same type (FLAT_1) like</p>

<p>(this.docs.req-least offer)/(least offer/100) = percentual difference</p></li>
<li>and print all documents incl the least_offer + least_offer_departement + difference</li>
</ul>

<p>The expected result would finally be something like</p>

<pre><code>{ type : "FLAT_1", least_offer : 422, least_offer_departement : "D_TG", departement : "C_TG", req: 495, diff : 17.29 }
{ type : "FLAT_1", least_offer : 422, least_offer_departement : "D_TG", departement : "F_TG", req: 480, diff : 13.74 }
{ type : "FLAT_1", least_offer : 422, least_offer_departement : "D_TG", departement : "D_TG", req: 420 , diff : -0.47 }

{ type : "FLAT_7", least_offer : 600, least_offer_departement : "F_TG", departement : "C_TG", req: 889, diff : 48.16 }
{ type : "FLAT_7", least_offer : 600, least_offer_departement : "F_TG", departement : "F_TG", req: 590, diff : -1.66 }
{ type : "FLAT_7", least_offer : 600, least_offer_departement : "F_TG", departement : "D_TG", req: 500, diff : -16.66 }

{ type : "FLAT_4", least_offer : 600, least_offer_departement : "F_TG", departement : "C_TG", req: 599, diff : -0.16 }
{ type : "FLAT_4", least_offer : 600, least_offer_departement : "F_TG", departement : "F_TG", req: 590, diff : -1.66 }
{ type : "FLAT_4", least_offer : 600, least_offer_departement : "F_TG", departement : "D_TG", req: 735, diff : 22.5 }
</code></pre>

<p>best regards, Simon</p>

