I have a class <strong>Test</strong> which has an instance variable duration of class "<strong>javax.xml.datatype.Duration</strong>". Duration is an abstract class.
I am able to save data using rest request.But when I am retrieving saved data from DB using get request getting following error.</p>

<pre><code> {
    "timestamp": "2018-06-05T09:27:28.538+0000",
    "status": 500,
    "error": "Internal Server Error",
    "message": "Failed to instantiate com.sun.org.apache.xerces.internal.jaxp.datatype.DurationImpl using constructor NO_CONSTRUCTOR with arguments ",
    "path": "/user/test"
}
</code></pre>

<p>I have checked the DB to get the BSON representation</p>

<pre><code>{                                                                                                                                                                                                                                                    
  "_id" : "Arjun",
  "duration" : {
    "signum" : 1,
    "hours" : "2",                                                                                                                                                                                                                               
