add key to nested array with condition<p>I have a simple datastructure in mongodb:</p>

<pre><code>{
  _id: ObjectID,
 name: 'Name',
 birthday: '25.05.2001'
 items: [
          {
             _id: ObjectID,
             name: 'ItemName',
             info: 'ItemInfo',
           },
           {
             _id: ObjectID,
             name: 'ItemName',
             info: 'ItemInfo',
           }
        ]
}
</code></pre>

<p>Now i want a query, that takes a ObjectID (_id) of an item as criteria and gives me back the object with all items in the array AND projects a new field "selected" with value true or false into a field in the result of each array item:</p>

<p>I tried that with this query:</p>

<pre><code> { $unwind: '$items' },
 {
    $project: {
       selected: {
          $cond: { if: { 'items._id': itemObjectID }, then: true, else: false },
      },
    },
  },    
</code></pre>

<p>but MongoDB gives me back an error:   </p>

<pre><code>MongoError: FieldPath field names may not contain '.'.
</code></pre>

<p>Have no clue why its not working, any help or ideas? Thank you very much!</p>

